import React from 'react'

function Home() {


  const logout = () => {

    axios.get("http://localhost:4100/register/logout").then(res => {
      console.log("cikis yapildi!!!")
    }).catch(err => {
      console.log(err)
    })

  }


  return (
    <div>



      <button className = "btn btn-danger" onClick  = {logout}>log out</button>

    </div>
  )
}

export default Home
